<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Color-changing Product Image</title>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/jscolor/2.4.5/jscolor.min.js"></script>
    <style>
        body,
        html {
            margin: 0;
            padding: 0;
            height: 100%;
            width: 100%;
        }

        *,
        *:before,
        *:after {
            box-sizing: border-box;
        }

        #container {
            position: relative;
            width: 572px;
            height: 360px;
            margin: 40px auto;
            overflow: hidden;
        }

        #product-svg {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: 2;
            mix-blend-mode: multiply;
        }

        #product-shape {
            fill: #DBED64;
        }

        #background-image {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
        }

        .jscolor {
            position: fixed;
            bottom: 20px;
            right: 20px;
            z-index: 3;
            padding: 10px;
            border: none;
            border-radius: 5px;
            cursor: pointer;
        }
    </style>
</head>

<body>
    <div id="container">
        <svg width="572" id="product-svg" height="360" xmlns="http://www.w3.org/2000/svg">
            <path id="product-shape" d="M179,20h1v1h
        <img id=" background-image" src="./dress.jpg" alt="">
    </div>

    <input class="jscolor {onFineChange:'changeColor(this)'}" value="DBED64">

    <script>
        const overlay = document.getElementById("product-shape");

        function changeColor(picker) {
            overlay.style.fill = picker.toHEXString();
        }

        // Simulate background-size: cover for SVG
        const svg = document.getElementById("product-svg");
        const img = document.getElementById("background-image");
        const container = document.getElementById("container");

        window.onresize = () => simulateCover(container, svg, img, 1920, 1280);
        simulateCover(container, svg, img, 1920, 1280);

        function simulateCover(parent, child, image, x, y) {
            let { width, height } = parent.getBoundingClientRect();
            let yPercentage = x / y;
            let xPercentage = y / x;

            if (width < height * yPercentage) {
                child.style.width = height * yPercentage + "px";
                child.style.height = height + "px";
                image.style.width = height * yPercentage + "px";
                image.style.height = height + "px";
            } else {
                child.style.width = width + "px";
                child.style.height = width * xPercentage + "px";
                image.style.width = width + "px";
                image.style.height = width * xPercentage + "px";
            }
        }
    </script>
</body>

</html>
